    false,nt"url": null,nt"notes": "Overall, there is a need to bring all refuges
    in line with the new National Wildlife Refuge System mission, goals, and policies,
    as described in the National Wildlife Refuge System Improvement Act of 1997 (Improvement
    Act). A Comprehensive Conservation Plan (CCP), required by the Improvement Act,
    is needed to address u201cu2026significant problems that may adversely affect the
    populations and habitats of fish, wildlife and plants and the actions necessary
    to correct or mitigate such problems.u201d Specifically, problems and opportunities
    at Rose Atoll include: insufficient management access and surveillance; ensuring
    biological integrity, diversity and environmental health of refuge lands, seabird
    and migratory shorebird populations, coral reefs and associated waters; the need
    to restore degraded reef habitat; the need to evaluate and manage visitor use; the
    need to monitor, evaluate and control threats such as invasive species, illegal
    harvesting and fishing, illegal trespass on refuge lands, coral reefs and waters;
    and the need to instigate and maintain a comprehensive, consistent biological monitoring
    program. In addition, the Improvement Act requires the Service to consider increasing
    opportunities for people to experience wildlife-dependent recreation. The purpose
    of this Report is to advise the Service personnel involved in constructing the Rose
    Atoll NWR CCP on the refugeu2019s human environment, physical environment, and ecological
    setting.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
